import AllList from "./Components/AllList";
import MyList from "./Components/MyList";
import {useState} from 'react';
import './App.css';



function App() {
  const [myList , setmyList]= useState([]);
  const [myButton,setMyButton]= useState(false);
  const [allButton,setAllButton]= useState(false);

  function updateList(school){
    if(myList.indexOf(school) === -1)
      setmyList([...myList,school]);
  }

  return (
    < div className="APP">
      <div className="navbar">
            <button onClick={setMyButton}>My List</button>
            <button onClick={() => <div><AllList update={updateList}/></div>}>University List </button>
        </div>
        <MyList mL={myList}/>
        <AllList update={updateList}/>
    </div>
  )
}

export default App;
